import React from "react";
import Button from '../../../general/button/button';
import FormSignInJson from './form_signin_json';
import Title from '../../../general/title/title';
import RememberMe from './remember';
import './form_signin.css';

class FormSignIn extends React.Component{
  render(){
    return(
    <form action='/action_page.php' className='was-validated formsign'>
      <Title sclass="abouthead" id="logoheading" logo_head="Flash Box" slogan="Sign In"/>
      <div id="border">
    {FormSignInJson.map((item,index)=>{
      return(
        <div key={index} className='form-group'>
          <label for={item.for}>{item.lName}</label>
          <input type={item.type} class="form-control" id={item.id} placeholder={item.placeholder} name={item.name} required/>
          <div className="valid-feedback">{item.vValue}</div>
          <div className="invalid-feedback">{item.inValue}</div>
        </div>
      )})}
      <RememberMe/>
      <NoteSignUp/>
      </div>
    </form>
    )
  }
}

export default FormSignIn;
